The special attribute o:key, notifies the template engine that the current node can be identified by a key. The key can be of any types. The feature should be used when rendering a dynamic list where the items can be added/removed/shift. For each item, the o:key should be provided. So that, the engine will be able to efficiently discover the related DOM nodes. import {html, Template} from "@tmorin/ceb"
const lis = ["item A", "item B"].map(item => hmtl`<li o:key="${item}">${item}</li>`)
const template: Template = html`<div><ul>${lis}</ul></div>` When rendering within a Shadow DOM, the usage of the element <slot> have the same effect: the children of the slot element won't be processed.

