import {ElementBuilder} from "@tmorin/ceb"
// defines and register the custom element class
@ElementBuilder.get().decorate()
class SimpleGreeting extends HTMLElement { constructor(public name = "World") { super(); } connectedCallback() { this.textContent = `Hello, ${this.name}!` }
} Once registered, the Custom Element can be created with three different styles: markup, Object-Oriented and, hybrid. The first one relies on the tag name of the Custom Element within the markup of an HTML document. document.body.innerHTML = `<simple-greeting></simple-greeting>` The second one relies on the Object-Oriented nature of the Custom Element. Basically, the class can be instantiated, and the created object can be then append to the DOM. const helloJohn: SimpleGreeting = new SimpleGreeting("John")
document.body.appendChild(helloJohn) The last one lies between the markup and OO style. const helloDoe: SimpleGreeting = document.createElement("simple-greeting")
helloDoe.name = "Doe"
document.body.appendChild(helloDoe)

